message:
1 -  USAR DINHEIRO EM ESPÉCIE, PARAR DE USAR O CARTÃO DE CRÉDITO E SÓ USAR O PIX FAZENDO PAGAMENTOS MENORES PARA NÃO PAGAR O JUROS QUE AGORA O LULA DEU DE PRESENTE A ESTES BANQUEIROS, COM ISSO OS BANCOS TEM PERDAS DE JUROS;
2 -  ENCERRAR CONTAS, TIRAR DINHEIRO DO BANCO, PRINCIPALMENTE DOS BANQUEIROS APOIADORES DE LULA;
3 -  NÃO ENTREGAR MAIS COMBUSTÍVEL, PARALISAR AS ENTREGAS PARA OS   
POSTOS DE GASOLINA, COM ISTO FORÇA A POPULAÇÃO PARAR;
4 - PARAR, FECHAR OS PORTOS, NÃO EXPORTAR MAIS ALIMENTOS E NEM MAIS RECEBER PRODUTOS CHINESES. O FORO DE SÃO PAULO E CHINA ESTÃO ALINHADOS, SE REUNIRAM ESTES DIAS;
5 - PARAR BRASÍLIA POR EXCESSO DE PESSOAS, PRESSÃO NA CIDADE, CAMINHONEIROS PARAREM POR DENTRO E EM VOLTA NAS RODOVIAS, NÃO FECHEM POR ENQUANTO AS RODOVIAS, MAS PRA FRENTE EXISTE UMA ESTRATÉGIA PARA ISSO, CUIDADO, NÃO RECEBAM MULTAS;
6 - POVO QUE NÃO PUDEREM IREM PARA BRASÍLIA SE MANIFESTEM NAS CIDADES E NAS GRANDES CAPITAIS;
7 - ENCERRAR, CORTAR SERVIÇOS, EMPRESAS DA ESQUERDA, MÍDIA ETC;
8 – GREVE NOS AEROPORTOS, PARALISAR, ENCERRAR VOOS;
9 - PARALISAÇÃO TOTAL DOS CAMINHONEIROS, PARAR O AGRO;
10 - PRECIONAR O SENADO, FAZER OS SENADORES SE MOVEREM, A REAGIREM AOS DESMANDOS DO JUDICIÁRIO CONTRA A DITADURA DA PERSEGUIÇÃO  DOS MINISTROS DO STF. FAZER FORTE PRESSÃO AOS SENADORES E DEPUTADOS POR NOSSAS EXIGÊNCIAS.
_____________________________________________________________________ 
ESTAS AÇÕES DEVEM SEREM IMPLEMENTADAS O MAIS RÁPIDO POSSÍVEL. QUANTO TEMPO MAIS PASSAR, FICARÁ DIFÍCIL A VITÓRIA. NÃO PEÇAM NADA AS FFAA, TENHAM UM POUCO DE AMOR PRÓPRIO, NÃO SE REBAIXEM A QUEM NÃO OS OUVEM. NOSSO OBJETIVO, E A NOSSA META É A LIBERTAÇÃO DO PAÍS. AS FORÇAS ARMADAS AGIRÃO PORQUE OS FORÇAREMOS, SE ELES AINDA NÃO SABEM, SABERÃO, APRENDERÃO, A VIDA É ASSIM!. SE NÃO AGIREM O PAÍS TODO COLAPSARÁ, FICANDO VULNERÁVEL COM GRANDES POSSIBILIDADES DE INVASÕES E AÍ OS GENERAIS VERÃO O TAMANHO DO PROBLEMÃO QUE TERÃO, ENTÃO LÓGICO QUE AGIRÃO, SIM!!!, ELES SÃO ESPERTOS!. AGORA SEM POR FAVOR, SOS FFAA, NÃO SEJAM RIDÍCULOS. ESPEREI TODOS VOCÊS BATEREM A BUNDA NO MARMORE PARA QUE TALVEZ AGORA POSSAM ME OUVIR E ASSIM SENDO POSSAMOS AGIR CORRETAMENTE, PELA LIBERTAÇÃO DO BRASIL. QUE NOS SIRVA DE APRENDIZADO, NÓS SOMOS A FORÇA SOBERANA DESSE PAÍS, NÃO IDOLATRE, NÃO ADOREM NINGUÉM, DEUS É A NOSSA FORÇA E VITÓRIA. ESTA É A NOSSA MISSÃO, PARA QUE SEJAMOS COMO UM DESPERTAMENTO MUNDIAL CONTRA A NOVA ORDEM MUNDIAL, PODEMOS MOSTRAR COMO SE FAZ AOS POVOS DESESPERADOS, VIM TE CHAMAR NA ÚLTIMA HORA, VOCÊ ESTÁ COMIGO? SE LEVANTE, VAMOS SÓ NESSE PROPÓSITO, NÃO DEIXEM MUDAREM AS ESTRATÉGIAS AQUI EXPOSTAS, ISSO TEM MÉTODO, PARA DESENCADEAR O EFEITO DOMINÓ.
NÃO PENSE VOCÊ QUE ELES RESISTIRÃO MUITO TEMPO COM ESSAS NOSSAS AÇÕES, MAS NADA DE CEDERMOS, NADA DE MISERICÓRDIA, VAMOS AGIRMOS PARA A LIBERTAÇÃO DO BRASIL.
                                                  3 EXIGÊNCIAS
1 - QUEREMOS QUE TSE ENTREGUE O CÓDIGO FONTE E QUE AS FORÇAS ARMADAS FAÇAM A INVESTIGAÇÃO;
2 - (FICANDO PROVADO FRAUDE NAS ELEIÇÕES) PROMOVER UMA NOVA ELEIÇÃO;
3 - URNAS ELETRÔNICAS AUDITÁVEIS.
